$url: "https://raw.githubusercontent.com/ParkYoungWoong/overwatch-hero-selector-vanilla/master/images";
body {
    height: 100vh;
    background-image: url("#{$url}/bg.jpg");
    background-size: cover; /* 높이와 너비 중 더 넓은(긴) 쪽에 맞추어 결정 */
    background-repeat: no-repeat;
    background-attachment: fixed; /* 스크롤과 관계없이 배경이 뷰포트에 고정 */
}

.container {
    padding: 50px 0;
    .heroes {
        display: flex;
        flex-wrap: wrap;
        justify-content: center;
        max-width: 700px;
        margin: auto; /* 블록 요소의 가로 사이즈가 명시되어 있는 경우 좌, 우 여백을 동일한 폭으로 조정 */
        padding: 40px 20px;
        .hero {
            box-sizing: border-box;
            width: 80px;
            height: 84px;
            margin: 4px;
            border: 3px solid #fff;
            border-radius: 10px;
            background-color: #555;
            overflow: hidden;
            transform: skewX(-14deg);
            transition: 
                transform .1s,
                background-color .6s;
            &:hover {
                background-color: #ff9c00;
                transform: 
                    skewX(-14deg)
                    scale(1.3);
                z-index: 1;
            }
            .image {
                width: 140%;
                height: 100%;
                background-position: center;
                background-size: 90px;
                background-repeat: no-repeat;
                transform: 
                    skewX(14deg)
                    translateX(-16px);
            }
            // .hero
            @for $i from 1 through 32 {
                &:nth-child(#{$i}) .image {
                    background-image: url("#{$url}/hero#{$i}.png")
                }
            }
        }
    }
    .logo {
        max-width: 300px;
        margin: 0 auto;
        padding: 0 20px;
        img {
            width: 100%;
        }
    }
}
